import React, { Component } from "react";
import axios from "axios";

export default class DisplayOrders extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listData1: [],
    };
  }
  componentDidMount() {
    console.log(this.props.location); // it is equal to yourData
    this.setState({ listData1: this.props.location.state });
  }

  render() {
    return (
      <div>
        <div>
          <div
            style={{
              display: "flex",
              justifyContent: "flex-end",
              paddingTop: 20,
              paddingBottom: 20,
            }}
          >
            <input
              type="text"
              style={{ width: "50%" }}
              value={this.state.searchkey}
              className="form-control"
              placeholder="search for customer"
              onChange={(evt) => this.setState({ searchkey: evt.target.value })}
            />
          </div>
          <table class="table">
            <thead>
              <tr>
                <th scope="col">sno</th>
                <th scope="col">NAME</th>
                <th scope="col">SHOPNAME</th>
                <th scope="col">STATUS</th>
                <th scope="col">CREATEDAT</th>
              </tr>
            </thead>
            <tbody>
              {" "}
              {this.state.listData1
                .filter(searchingfor(this.state.searchkey))
                .map((item, i) => (
                  <tr>
                    <th scope="row">{i + 1}</th>

                    <td>{item.name}</td>
                    <td>{item.shopname}</td>
                    <td>{item.status}</td>
                    <td>{this.formatDate(item.createdAt)}</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}
